    /**
     * 将 16 进制字符串转换为二进制字符串
     *
     * @param hexString 16 进制字符串
     * @return 二进制字符串
     */
    public static String keyWordBinaryString(String hexString) {
        StringBuilder stringBuilder = new StringBuilder(65392);
        for (char c : hexString.toCharArray()) {
            stringBuilder.append(HEX_BINARY.get(c));
        }
        return stringBuilder.toString();
    }
